{"operationName":"LoginUser","variables":{"username":"$_1@gmail.com","password":"$_1"},"extensions":{"persistedQuery":{"version":1,"sha256Hash":"b086ee13bc3e366a76606534cf528d68924bad6363d3c429245f6492f1300245"}},"query":"mutation LoginUser($username: String!, $password: String!) {
  login(input: {clientMutationId: "unique", username: $username, password: $password}) {
    authToken
    refreshToken
    user {
      databaseId
      letters
      avatar {
        url
        __typename
      }
      name
      __typename
    }
    __typename
  }
}
"}

{"operationName":"Registrazione","variables":{"email":"$_1@outlook.com","firstName":"$_1","lastName":"$_1","fcEnte":124,"fcGruppoBancario":null,"fcBancaAltro":"","fcEnteSocitaSistema":182,"fcEnteSocietaSistemaAltro":"","fcRuoloPrimario":291,"fcAmbitoLavorativo":299,"fcAmbitoLavorativoAltro":"","city":"Shibuya City","province":"AN","mobilePhone":"432354546","newsletterFedercasse":"1"},"extensions":{"persistedQuery":{"version":1,"sha256Hash":"4d305d8887c5d987c7350ce010f598d9ef6fb5e5991c08477fc8fe5b4c29d849"}},"query":"mutation Registrazione($email: String!, $firstName: String, $lastName: String, $fcEnte: Int, $fcGruppoBancario: Int, $fcNomeBanca: Int, $fcBancaAltro: String, $fcCapoGruppo: Int, $fcFederazioneLocale: Int, $fcEnteSocitaSistema: Int, $fcEnteSocietaSistemaAltro: String, $fcRuoloPrimario: Int, $fcAmbitoLavorativo: Int, $fcAmbitoLavorativoAltro: String, $city: String, $province: String, $mobilePhone: String, $newsletterFedercasse: String) {
  registerUser(input: {clientMutationId: "registrazione", firstName: $firstName, username: $email, lastName: $lastName, fcEnte: $fcEnte, fcGruppoBancario: $fcGruppoBancario, fcNomeBanca: $fcNomeBanca, fcNomeBancaAltro: $fcBancaAltro, fcCapogruppo: $fcCapoGruppo, fcFederazioneLocale: $fcFederazioneLocale, fcEnteSocietaSistema: $fcEnteSocitaSistema, fcEnteSocietaSistemaAltro: $fcEnteSocietaSistemaAltro, fcRuoloPrimario: $fcRuoloPrimario, fcAmbitoLavorativo: $fcAmbitoLavorativo, fcAmbitoLavorativoAltro: $fcAmbitoLavorativoAltro, city: $city, province: $province, email: $email, mobilePhone: $mobilePhone, newsletterFedercasse: $newsletterFedercasse}) {
    user {
      registeredDate
      userId
      __typename
    }
    __typename
  }
}
"}
